description:
&quot;Lisa Loves directs this sensual, evocative film which explores the raw sensitivity of new lovers. Each beautiful couple shares a tenderness that is only matched by their hot passion, which burns through the screen and engages the viewer immediately. Starring Hannah Shaw, Megan Coxxx and many other riveting performers, this artful tribute to erotic encounters builds up sexual tension to a stunning climax and then delivers full satisfaction. And in each fulfilling scene, the action begins with a warm embrace.&quot;

Hannah Shaw, Megan Coxxx, Lucie Love, Lou Charmelle, Cathy Heaven, Peter Oh Tool, Jamie Barry, Andy Mann, Kai Taylor, Pascal White

